import { VideoList } from "./context/appContext";

 const Mental = ()=> {
    return (
        <AppContextProvider>
        <div class="topic-container">
            <h1 className="title">Mental Health</h1>
            {/* Automatically render the VideoList component */}
            <VideoList />
        </div>
    </AppContextProvider>
    )
}
export default Mental;
